import React, { useState } from "react";

const pages = [
    { name: "Home", path: "/" },
    { name: "Projects", path: "/projects" },
    { name: "Career", path: "/career" },
    { name: "Other Interests", path: "/other-interests" },
];

const Navbar = () => {
    const [drawerOpen, setDrawerOpen] = useState(false);

    const handleDrawerToggle = () => setDrawerOpen((open) => !open);

    return (
        <>
            <nav className="navbar bg-secondary backdrop-blur-md shadow-md rounded-b-lg">
                <div className="navbar-content max-w-7xl mx-auto flex items-center justify-between px-4 py-2">
                    <div className="navbar-logo text-primary font-bold text-xl">My Portfolio</div>
                    <div className="navbar-links hidden md:flex space-x-4">
                        {pages.map((page) => (
                            <a key={page.path} href={page.path} className="text-accent hover:text-primary transition">
                                {page.name}
                            </a>
                        ))}
                    </div>
                    <button
                        className="navbar-menu-btn md:hidden bg-primary text-white p-2 rounded-lg"
                        onClick={handleDrawerToggle}
                        aria-label="Open navigation menu"
                    >
                        <span className="navbar-menu-icon block w-6 h-0.5 bg-white relative">
                            <span className="block w-6 h-0.5 bg-white absolute -top-2"></span>
                            <span className="block w-6 h-0.5 bg-white absolute top-2"></span>
                        </span>
                    </button>
                </div>
            </nav>
            <div className={`navbar-drawer ${drawerOpen ? "open" : ""}`}>
                <button
                    className="navbar-drawer-close"
                    onClick={handleDrawerToggle}
                    aria-label="Close navigation menu"
                >
                    &times;
                </button>
                <div className="navbar-drawer-links">
                    {pages.map((page) => (
                        <a
                            key={page.path}
                            href={page.path}
                            className="navbar-drawer-link"
                            onClick={() => setDrawerOpen(false)}
                        >
                            {page.name}
                        </a>
                    ))}
                </div>
            </div>
            <div
                className={`navbar-backdrop ${drawerOpen ? "open" : ""}`}
                onClick={handleDrawerToggle}
            />
            <div className="home-container">
                {/* Your home content here */}
            </div>
            <style>{`
                .navbar {
                    position: fixed;
                    top: 0;
                    left: 0;
                    right: 0;
                    height: 60px;
                    background: #222;
                    color: #fff;
                    z-index: 1000;
                    box-shadow: 0 2px 8px rgba(0,0,0,0.07);
                }
                .home-container {
                    margin-top: 60px; /* Push content below the navbar */
                }
                .navbar-content {
                    max-width: 1200px;
                    margin: 0 auto;
                    height: 100%;
                    display: flex;
                    align-items: center;
                    justify-content: space-between;
                    padding: 0 24px;
                }
                .navbar-logo {
                    font-weight: bold;
                    font-size: 1.3rem;
                }
                .navbar-links {
                    display: flex;
                    gap: 24px;
                }
                .navbar-link {
                    color: #fff;
                    text-decoration: none;
                    font-size: 1rem;
                    transition: color 0.2s;
                }
                .navbar-link:hover {
                    color: #4fd1c5;
                }
                .navbar-menu-btn {
                    display: none;
                    background: none;
                    border: none;
                    cursor: pointer;
                    padding: 8px;
                }
                .navbar-menu-icon {
                    display: block;
                    width: 28px;
                    height: 3px;
                    background: #fff;
                    position: relative;
                }
                .navbar-menu-icon::before,
                .navbar-menu-icon::after {
                    content: '';
                    display: block;
                    width: 28px;
                    height: 3px;
                    background: #fff;
                    position: absolute;
                    left: 0;
                    transition: 0.2s;
                }
                .navbar-menu-icon::before {
                    top: -9px;
                }
                .navbar-menu-icon::after {
                    top: 9px;
                }
                /* Drawer styles */
                .navbar-drawer {
                    position: fixed;
                    top: 0;
                    right: -100%; /* Fully retract the drawer */
                    width: 260px;
                    height: 100vh;
                    background: #222;
                    color: #fff;
                    z-index: 1200;
                    box-shadow: -2px 0 8px rgba(0,0,0,0.12);
                    transition: right 0.3s;
                    display: flex;
                    flex-direction: column;
                    padding: 24px 16px;
                }
                .navbar-drawer.open {
                    right: 0;
                }
                .navbar-drawer-close {
                    background: none;
                    border: none;
                    color: #fff;
                    font-size: 2rem;
                    align-self: flex-end;
                    cursor: pointer;
                    margin-bottom: 24px;
                }
                .navbar-drawer-links {
                    display: flex;
                    flex-direction: column;
                    gap: 20px;
                }
                .navbar-drawer-link {
                    color: #fff;
                    text-decoration: none;
                    font-size: 1.1rem;
                }
                .navbar-drawer-link:hover {
                    color: #4fd1c5;
                }
                .navbar-backdrop {
                    display: none;
                }
                .navbar-backdrop.open {
                    display: block;
                    position: fixed;
                    top: 0; left: 0; right: 0; bottom: 0;
                    background: rgba(0,0,0,0.3);
                    z-index: 1100;
                }
                /* Responsive */
                @media (max-width: 768px) {
                    .navbar-links {
                        display: none;
                    }
                    .navbar-menu-btn {
                        display: block;
                    }
                }
            `}</style>
        </>
    );
};

export default Navbar;
